import{_ as e,c as t,o,d as i}from"./app.a07ec8df.js";const m=JSON.parse('{"title":"\u9644\u5F55 E\uFF1A\u7248\u672C","description":"","frontmatter":{},"headers":[],"relativePath":"appendix-05-editions.md","lastUpdated":1671182487000}'),s={name:"appendix-05-editions.md"},a=i('<h1 id="\u9644\u5F55-e-\u7248\u672C" tabindex="-1">\u9644\u5F55 E\uFF1A\u7248\u672C <a class="header-anchor" href="#\u9644\u5F55-e-\u7248\u672C" aria-hidden="true">#</a></h1><blockquote><p><a href="https://github.com/rust-lang/book/blob/main/src/appendix-05-editions.md" target="_blank" rel="noreferrer">appendix-05-editions.md</a><br> commit 8cf0496bb8e56b683ea3f015871c8631684decf4</p></blockquote><p>\u65E9\u5728\u7B2C\u4E00\u7AE0\uFF0C\u6211\u4EEC\u89C1\u8FC7 <code>cargo new</code> \u5728 <em>Cargo.toml</em> \u4E2D\u589E\u52A0\u4E86\u4E00\u4E9B\u6709\u5173 <code>edition</code> \u7684\u5143\u6570\u636E\u3002\u672C\u9644\u5F55\u5C06\u89E3\u91CA\u5176\u610F\u4E49\uFF01</p><p>Rust \u8BED\u8A00\u548C\u7F16\u8BD1\u5668\u6709\u4E00\u4E2A\u4E3A\u671F 6 \u5468\u7684\u53D1\u5E03\u5FAA\u73AF\u3002\u8FD9\u610F\u5473\u7740\u7528\u6237\u4F1A\u7A33\u5B9A\u5F97\u5230\u65B0\u529F\u80FD\u7684\u66F4\u65B0\u3002\u5176\u4ED6\u7F16\u7A0B\u8BED\u8A00\u53D1\u5E03\u5927\u66F4\u65B0\u4F46\u4E0D\u751A\u9891\u7E41\uFF1BRust \u9009\u62E9\u66F4\u4E3A\u9891\u7E41\u7684\u53D1\u5E03\u5C0F\u66F4\u65B0\u3002\u4E00\u6BB5\u65F6\u95F4\u4E4B\u540E\uFF0C\u6240\u6709\u8FD9\u4E9B\u5C0F\u66F4\u65B0\u4F1A\u65E5\u79EF\u6708\u7D2F\u3002\u4E0D\u8FC7\u968F\u7740\u5C0F\u66F4\u65B0\u9010\u6B21\u7684\u53D1\u5E03\uFF0C\u6216\u8BB8\u5F88\u96BE\u56DE\u8FC7\u5934\u6765\u611F\u53F9\uFF1A\u201C\u54C7\uFF0C\u4ECE Rust 1.10 \u5230 Rust 1.31\uFF0CRust \u7684\u53D8\u5316\u771F\u5927\uFF01\u201D</p><p>\u6BCF\u4E24\u5230\u4E09\u5E74\uFF0CRust \u56E2\u961F\u4F1A\u751F\u6210\u4E00\u4E2A\u65B0\u7684 Rust <strong>\u7248\u672C</strong>\uFF08<em>edition</em>\uFF09\u3002\u6BCF\u4E00\u4E2A\u7248\u672C\u4F1A\u7ED3\u5408\u5DF2\u7ECF\u843D\u5730\u7684\u529F\u80FD\uFF0C\u5E76\u63D0\u4F9B\u4E00\u4E2A\u6E05\u6670\u7684\u5E26\u6709\u5B8C\u6574\u66F4\u65B0\u6587\u6863\u548C\u5DE5\u5177\u7684\u529F\u80FD\u5305\u3002\u65B0\u7248\u672C\u4F1A\u4F5C\u4E3A\u5E38\u89C4\u7684 6 \u5468\u53D1\u5E03\u8FC7\u7A0B\u7684\u4E00\u90E8\u5206\u53D1\u5E03\u3002</p><p>\u8FD9\u4E3A\u4E0D\u540C\u7684\u4EBA\u7FA4\u63D0\u4F9B\u4E86\u4E0D\u540C\u7684\u529F\u80FD\uFF1A</p><ul><li>\u5BF9\u4E8E\u6D3B\u8DC3\u7684 Rust \u7528\u6237\uFF0C\u5176\u5C06\u589E\u91CF\u7684\u4FEE\u6539\u4E0E\u6613\u4E8E\u7406\u89E3\u7684\u529F\u80FD\u5305\u76F8\u7ED3\u5408\u3002</li><li>\u5BF9\u4E8E\u975E\u7528\u6237\uFF0C\u5B83\u8868\u660E\u53D1\u5E03\u4E86\u4E00\u4E9B\u91CD\u5927\u8FDB\u5C55\uFF0C\u8FD9\u610F\u5473\u7740 Rust \u53EF\u80FD\u53D8\u5F97\u503C\u5F97\u4E00\u8BD5\u3002</li><li>\u5BF9\u4E8E Rust \u81EA\u8EAB\u5F00\u53D1\u8005\uFF0C\u5176\u63D0\u4F9B\u4E86\u9879\u76EE\u6574\u4F53\u7684\u96C6\u5408\u70B9\u3002</li></ul><p>\u5728\u672C\u6587\u6863\u7F16\u5199\u65F6\uFF0CRust \u6709\u4E09\u4E2A\u53EF\u7528\u7248\u672C\uFF1ARust 2015\u3001 Rust 2018 \u548C Rust 2021\u3002\u672C\u4E66\u57FA\u4E8E Rust 2021 edition \u98CE\u683C\u7F16\u5199\u3002</p><p><em>Cargo.toml</em> \u4E2D\u7684 <code>edition</code> \u5B57\u6BB5\u8868\u660E\u4EE3\u7801\u5E94\u8BE5\u4F7F\u7528\u54EA\u4E2A\u7248\u672C\u7F16\u8BD1\u3002\u5982\u679C\u8BE5\u5B57\u6BB5\u4E0D\u5B58\u5728\uFF0C\u5176\u9ED8\u8BA4\u4E3A <code>2015</code> \u4EE5\u63D0\u4F9B\u540E\u5411\u517C\u5BB9\u6027\u3002</p><p>\u6BCF\u4E2A\u9879\u76EE\u90FD\u53EF\u4EE5\u9009\u62E9\u4E0D\u540C\u4E8E\u9ED8\u8BA4\u7684 2015 edition \u7684\u7248\u672C\u3002\u8FD9\u6837\uFF0C\u7248\u672C\u53EF\u80FD\u4F1A\u5305\u542B\u4E0D\u517C\u5BB9\u7684\u4FEE\u6539\uFF0C\u6BD4\u5982\u65B0\u589E\u5173\u952E\u5B57\u53EF\u80FD\u4F1A\u4E0E\u4EE3\u7801\u4E2D\u7684\u6807\u8BC6\u7B26\u51B2\u7A81\u5E76\u5BFC\u81F4\u9519\u8BEF\u3002\u4E0D\u8FC7\u9664\u975E\u9009\u62E9\u517C\u5BB9\u8FD9\u4E9B\u4FEE\u6539\uFF0C\uFF08\u65E7\uFF09\u4EE3\u7801\u4ECD\u5C06\u80FD\u591F\u7F16\u8BD1\uFF0C\u5373\u4FBF\u5347\u7EA7\u4E86 Rust \u7F16\u8BD1\u5668\u7684\u7248\u672C\u3002</p><p>\u6240\u6709 Rust \u7F16\u8BD1\u5668\u90FD\u652F\u6301\u4EFB\u4F55\u4E4B\u524D\u5B58\u5728\u7684\u7F16\u8BD1\u5668\u7248\u672C\uFF0C\u5E76\u53EF\u4EE5\u94FE\u63A5\u4EFB\u4F55\u652F\u6301\u7248\u672C\u7684 crate\u3002\u7F16\u8BD1\u5668\u4FEE\u6539\u53EA\u5F71\u54CD\u6700\u521D\u7684\u89E3\u6790\u4EE3\u7801\u7684\u8FC7\u7A0B\u3002\u56E0\u6B64\uFF0C\u5982\u679C\u4F60\u4F7F\u7528 Rust 2015 \u800C\u67D0\u4E2A\u4F9D\u8D56\u4F7F\u7528 Rust 2018\uFF0C\u4F60\u7684\u9879\u76EE\u4ECD\u65E7\u80FD\u591F\u7F16\u8BD1\u5E76\u4F7F\u7528\u8BE5\u4F9D\u8D56\u3002\u53CD\u4E4B\uFF0C\u82E5\u9879\u76EE\u4F7F\u7528 Rust 2018 \u800C\u4F9D\u8D56\u4F7F\u7528 Rust 2015 \u4EA6\u53EF\u5DE5\u4F5C\u3002</p><p>\u6709\u4E00\u70B9\u9700\u8981\u660E\u786E\uFF1A\u5927\u90E8\u5206\u529F\u80FD\u5728\u6240\u6709\u7248\u672C\u4E2D\u90FD\u80FD\u4F7F\u7528\u3002\u5F00\u53D1\u8005\u4F7F\u7528\u4EFB\u4F55 Rust \u7248\u672C\u5C06\u80FD\u7EE7\u7EED\u63A5\u6536\u6700\u65B0\u7A33\u5B9A\u7248\u7684\u6539\u8FDB\u3002\u7136\u800C\u5728\u4E00\u4E9B\u60C5\u51B5\uFF0C\u4E3B\u8981\u662F\u589E\u52A0\u4E86\u65B0\u5173\u952E\u5B57\u7684\u65F6\u5019\uFF0C\u5219\u53EF\u80FD\u51FA\u73B0\u4E86\u53EA\u80FD\u7528\u4E8E\u65B0\u7248\u672C\u7684\u529F\u80FD\u3002\u53EA\u9700\u5207\u6362\u7248\u672C\u5373\u53EF\u5229\u7528\u65B0\u7248\u672C\u7684\u529F\u80FD\u3002</p><p>\u8BF7\u67E5\u770B <a href="https://rust-lang-nursery.github.io/edition-guide/" target="_blank" rel="noreferrer">Edition Guide</a> \u4E86\u89E3\u66F4\u591A\u7EC6\u8282\uFF0C\u8FD9\u662F\u4E00\u4E2A\u5B8C\u5168\u4ECB\u7ECD\u7248\u672C\u7684\u4E66\u7C4D\uFF0C\u5305\u62EC\u5982\u4F55\u901A\u8FC7 <code>cargo fix</code> \u81EA\u52A8\u5C06\u4EE3\u7801\u8FC1\u79FB\u5230\u65B0\u7248\u672C\u3002</p>',13),d=[a];function r(n,p,c,u,l,_){return o(),t("div",null,d)}const h=e(s,[["render",r]]);export{m as __pageData,h as default};
